import Config from "../../Config";
const AdminBlogsList = ({ handleEditModal, blog, handleWorkingBlog }) => {
  return (
    <tr key={blog._id}>
      <td>
        <img
          src={`${Config.baseUrl}/uploads/blogs/${blog.imageUrl}`}
          alt={blog.title}
          className="blog-image"
          style={{ maxWidth: "200px" }}
        />
      </td>
      <td>{blog.views}</td>
      <td>{blog.comments}</td>
      <td>{blog.likes}</td>
      <td>
        <button
          className="table-btn"
          onClick={() => {
            handleWorkingBlog();
            handleEditModal();
          }}
        >
          Edit
        </button>
      </td>
      <td>
        <button className="table-btn">Delete</button>
      </td>
    </tr>
  );
};

export default AdminBlogsList;
